import "./App.css";
import { Login } from "./pages/login";
import { BrowserRouter, Rountes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Rountes>
        <Login />
      </Rountes>
    </BrowserRouter>
  );
}

export default App;
